import React from 'react';


function Classic() {
    return (
        <div>
            <h1>Your style type is Classic. </h1>
            <img alt="" src="https://www.proprofs.com/api/ckeditor_images/New%20Project%20(11)(57).jpg" />
            <h3 className='resultDescr'>You gravitate toward wardrobe essentials that will always be in fashion. You rock these outfits harder than Jimi Hendrix rocked a guitar</h3>
        </div>
    );
};



export default Classic;
